import React from 'react';
import Card from './Card';

const CardList = ({ kanjiList }) => {
	return(		
		<div>
			{
				kanji.map((aKanji, i) => { 
					return (
						<Card 
						key={i} 
						character={kanji[i].character} 
						reading={kanji[i].kunyomi+" "+kanji[i].onyomi}
						meaning={kanji[i].meaning}
						/>
					);
				})
			}
		</div>

	);
}

export default CardList;

